import React from 'react';
import { useParams } from 'react-router-dom';

function Verify() {

    const [token, setToken] = useState("");
    let  { lff }  = useParams();
    setToken(lff);

    return (
        <div>
        <h1>fwrofnre</h1>
            <h3 onChange={(e) => {
                                                setToken(e.target.value);
                                            }} > toekn : {token} </h3>
        </div>
    );
}

export default Verify;
